import React from "react";
import styled from "styled-components";
import cover from "../assets/cover.png";

const DeckWrapper = styled.div`
  width: 100px;
  height: 160px;
`

const DeckImg = styled.div`
  background-image: url(${cover});
  background-size: cover;
`;

function Deck() {
  return (
    <div>
      <DeckImg></DeckImg>
    </div>
  );
}

export default Deck;
